import { Pipe, PipeTransform } from '@angular/core'

@Pipe({
  name: 'calculadora'
})

export class CalculadoraPipe implements PipeTransform {
  transform(value1: any,value2: any) {
    let operaciones = `
      suma: ${value1+value2};
      resta: ${value1-value2};
      multiplicación: ${value*value};
      división: ${value/value};
    `
    return operaciones;
  }
}
